webpackJsonp([48],{916:function(n,l){n.exports='<div id="content">\n\n  <!-- Bread crumb is created dynamically -->\n  <!-- row -->\n  <div class="row">\n\n    <!-- col -->\n    <div class="col-xs-12 col-sm-12 col-md-12 col-lg-12">\n      <h1 class="page-title txt-color-blueDark text-center well">\n\n        <!-- PAGE HEADER -->\n        SmartAdmin Layout Options<br>\n        <small class="text-success">Morph SmartAdmin to your need! The layout of SmartAdmin is extreamly flexible\n        </small>\n      </h1>\n\n    </div>\n    <!-- end col -->\n\n  </div>\n  <!-- end row -->\n\n  <!--\n      The ID "widget-grid" will start to initialize all Widgets below\n      You do not need to use Widgets if you dont want to. Simply remove\n      the <section></section> and you can use wells or panels instead\n      -->\n\n  <!-- widget grid -->\n  <section id="widget-grid" class="">\n\n    <!-- row -->\n\n    <div class="row">\n\n      <!-- a blank row to get started -->\n      <div class="col-sm-6">\n        <!-- your contents here -->\n        <div class="well text-center">\n          <h5>\n            Layout type "<strong>Navigation Minified</strong>" <br>\n            <small>\n              Add the following class(s) to body tag\n              <code>.minified</code>\n            </small>\n          </h5>\n          <h5>\n            <small>\n              <i>\n                Avalible options\n              </i>\n            </small>\n          </h5>\n          <span class="label label-default">.fixed-navigation</span>\n          <span class="label label-default">.container</span>\n          <span class="label label-default">.fixed-page-footer</span>\n          <span class="label label-default">.fixed-header</span>\n          <span class="label label-default">.fixed-ribbon</span>\n          <span class="label label-default">.smart-rtl</span>\n          <br>\n          <br>\n\n          <img src="assets/img/demo/layout-skins/layout-collapse.png" class="img-responsive center-block"\n               style="box-shadow: 0px 0px 3px 0px #919191;">\n        </div>\n      </div>\n      <div class="col-sm-6">\n        <!-- your contents here -->\n        <div class="well text-center">\n          <h5>\n            Layout type "<strong>Hidden Navigation</strong>" <br>\n            <small>Add the following class(s) to body tag <code>.hidden-menu</code></small>\n          </h5>\n          <h5>\n            <small>\n              <i>\n                Avalible options\n              </i>\n            </small>\n          </h5>\n          <span class="label label-default">.fixed-navigation</span>\n          <span class="label label-default">.container</span>\n          <span class="label label-default">.fixed-page-footer</span>\n          <span class="label label-default">.fixed-header</span>\n          <span class="label label-default">.fixed-ribbon</span>\n          <span class="label label-default">.smart-rtl</span>\n          <br>\n          <br>\n          <img src="assets/img/demo/layout-skins/layout-hidden.png" class="img-responsive center-block"\n               style="box-shadow: 0px 0px 3px 0px #919191;">\n        </div>\n      </div>\n\n    </div>\n    <div class="row">\n\n      <!-- a blank row to get started -->\n      <div class="col-sm-6">\n        <!-- your contents here -->\n        <div class="well text-center">\n          <h5>\n            Layout type "<strong>Menu on Top with center content</strong>" <br>\n            <small>Add the following class(s) to body tag <code>.top-navigation .container</code></small>\n          </h5>\n          <h5>\n            <small>\n              <i>\n                Avalible options\n              </i>\n            </small>\n          </h5>\n          <span class="label label-default">.fixed-navigation</span>\n          <span class="label label-default">.fixed-page-footer</span>\n          <span class="label label-default">.fixed-header</span>\n          <span class="label label-default">.fixed-ribbon</span>\n          <span class="label label-default">.smart-rtl</span>\n          <br>\n          <br>\n          <img src="assets/img/demo/layout-skins/layout-menutop.png" class="img-responsive center-block"\n               style="box-shadow: 0px 0px 3px 0px #919191;">\n        </div>\n      </div>\n      <div class="col-sm-6">\n        <!-- your contents here -->\n        <div class="well text-center">\n          <h5>\n            Layout type "<strong>Center content with minified nav</strong>" <br>\n            <small>Add the following class(s) to body tag <code>.minified .container</code></small>\n          </h5>\n          <h5>\n            <small>\n              <i>\n                Avalible options\n              </i>\n            </small>\n          </h5>\n          <span class="label label-default">.top-navigation</span>\n          <span class="label label-default">.fixed-navigation</span>\n          <span class="label label-default">.fixed-page-footer</span>\n          <span class="label label-default">.fixed-header</span>\n          <span class="label label-default">.fixed-ribbon</span>\n          <span class="label label-default">.smart-rtl</span>\n          <br>\n          <br>\n          <img src="assets/img/demo/layout-skins/layout-collapse-minified.png" class="img-responsive center-block"\n               style="box-shadow: 0px 0px 3px 0px #919191;">\n        </div>\n      </div>\n\n    </div>\n    <div class="row">\n\n      <!-- a blank row to get started -->\n      <div class="col-sm-6">\n        <!-- your contents here -->\n        <div class="well text-center">\n          <h5>\n            Layout type "<strong>RTL Layout</strong>" <br>\n            <small>Add the following class(s) to body tag <code>.smart-rtl</code></small>\n          </h5>\n          <h5>\n            <small>\n              <i>\n                Avalible options\n              </i>\n            </small>\n          </h5>\n          <span class="label label-default">.container</span>\n          <span class="label label-default">.hidden-menu</span>\n          <span class="label label-default">.fixed-page-footer</span>\n          <span class="label label-default">.fixed-header</span>\n          <span class="label label-default">.fixed-ribbon</span>\n          <span class="label label-default">.minified</span>\n          <br>\n          <br>\n          <img src="assets/img/demo/layout-skins/layout-rtl.png" class="img-responsive center-block"\n               style="box-shadow: 0px 0px 3px 0px #919191;">\n        </div>\n      </div>\n      <div class="col-sm-6">\n        <!-- your contents here -->\n        <div class="well text-center">\n          <h5>\n            Layout type "<strong>RTL with Menu on Top</strong>" <br>\n            <small>Add the following class(s) to body tag <code>.smart-rtl .top-navigation</code></small>\n          </h5>\n          <h5>\n            <small>\n              <i>\n                Avalible options\n              </i>\n            </small>\n          </h5>\n          <span class="label label-default">.fixed-navigation</span>\n          <span class="label label-default">.container</span>\n          <span class="label label-default">.fixed-page-footer</span>\n          <span class="label label-default">.fixed-header</span>\n          <span class="label label-default">.fixed-ribbon</span>\n          <br>\n          <br>\n          <img src="assets/img/demo/layout-skins/layout-rtl-menutop.png" class="img-responsive center-block"\n               style="box-shadow: 0px 0px 3px 0px #919191;">\n        </div>\n      </div>\n\n    </div>\n    <!-- end row -->\n\n  </section>\n  <!-- end widget grid -->\n\n\n</div>'}});